import React from 'react'

import { Link, Element } from 'react-scroll'

export default function () {

    return (
      <div id='section'>

        <Link activeClass='active' to='firstInsideContainer' spy smooth duration={250} containerId='containerElement' >
          Go to first element inside container
        </Link>

        <Link activeClass='active' to='secondInsideContainer' spy smooth duration={250} containerId='containerElement'>
          Go to second element inside container
        </Link>

        <Element name='test7' className='element' id='containerElement' style={{
          position: 'relative',
          height: '200px',
          overflow: 'scroll',
          marginBottom: '100px'
        }}>

          <Element name='firstInsideContainer' style={{
            marginBottom: '200px'
          }}>
            first element inside container
          </Element>

          <Element name='secondInsideContainer' style={{
            marginBottom: '200px'
          }}>
            second element inside container
          </Element>
        </Element>

      </div>
    )
  }
